CREATE SEQUENCE IF NOT EXISTS seq_paises AS SMALLINT INCREMENT 1 MINVALUE 1 START 1;
CREATE TABLE Paises(
	PAI_PaisId SMALLINT PRIMARY KEY NOT NULL DEFAULT nextval('seq_paises'::regclass),
	PAI_Nombre VARCHAR(100) NOT NULL,
	PAI_Nombre_Largo VARCHAR(255) DEFAULT NULL,
	PAI_Clave VARCHAR(5) NULL,
	PAI_Nacionalidad VARCHAR(100) NULL,
	PAI_Predeterminado BOOLEAN DEFAULT FALSE
);

CREATE SEQUENCE IF NOT EXISTS seq_estados AS INTEGER INCREMENT 1 MINVALUE 1 START 1;
CREATE TABLE Estados(
	EST_EstadoId INTEGER PRIMARY KEY NOT NULL DEFAULT nextval('seq_estados'::regclass),
	EST_PAI_PaisId SMALLINT NOT NULL,
	EST_Nombre VARCHAR(150) NOT NULL,
	EST_ClaveEntidad VARCHAR NULL,
	EST_Predeterminado BOOLEAN DEFAULT FALSE,
	CONSTRAINT EST_PAI_PaisId_fk FOREIGN KEY(EST_PAI_PaisId) REFERENCES Paises(PAI_PaisId)
);

CREATE SEQUENCE IF NOT EXISTS seq_municipios AS INTEGER INCREMENT 1 MINVALUE 1 START 1;
CREATE TABLE Municipios(
	MUN_MunicipioId INTEGER PRIMARY KEY NOT NULL DEFAULT nextval('seq_municipios'::regclass),
	MUN_EST_EstadoId SMALLINT NOT NULL,
	MUN_Nombre VARCHAR(150) NOT NULL,
	MUN_ClaveMunicipio VARCHAR(20) NULL,
	MUN_Predeterminado BOOLEAN DEFAULT FALSE,
	CONSTRAINT MUN_EST_EstadoId_fk FOREIGN KEY(MUN_EST_EstadoId) REFERENCES Estados(EST_EstadoId)
);

